import React from 'react'

export default function News() {
  return (
    <div className='style'>
        <li className='li'>Tin mới</li>
        <li className='li'>Tin tức du lịch</li>
        <li className='li'>Cẩm nang du lịch</li>
        <li className='li'>Kinh nghiệm du lịch</li>
    </div>
  )
}
